import React from "react";
import { Link } from "react-router-dom";

const BrandList = [
  {
    image: "./images/brand/brand-1.png",
  },
  {
    image: "./images/brand/brand-2.png",
  },
  {
    image: "./images/brand/brand-3.png",
  },
  {
    image: "./images/brand/brand-4.png",
  },
  {
